import React from 'react';
import { BrowserRouter, Routes, Route} from 'react-router-dom';
import './App.css';
import NavBar from './components/NavBar/NavBar.jsx';

function App() {
  return (
    <BrowserRouter>
      <Routes>
          <Route path='/'element={<NavBar/>}></Route>

      </Routes>

    </BrowserRouter>

  );
}

export default App;
